import PokemonListItem from "./PokemonListItem";

export default function PokemonList({ pokemons, news }){
    console.log(pokemons);
    return(
        <div>
            {pokemons?.map((pokemon, index) => 
            <PokemonListItem key={index} {...pokemon} />)
        }
        </div>
    );
}
